import React, { Component } from 'react';
import styles from './LevelsItem.module.scss';
import { Container, Row, Col } from 'reactstrap';


export default class LevelsItem extends Component {
  constructor(props){
    super(props);
  }

  render() {
    return (
      <li md={6} lg={4} className={styles.levels__item}></li>
    )
  }
}
